  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation.nn               ZIP Code Tabulation Areas (ZCTAs) are approximate area representations
  of U.S. Postal Service (USPS) ZIP Code service areas that the Census Bureaun               creates
  to present statistical data for each decennial census. The Census Bureau delineates
  ZCTA boundaries for the United States, Puerto Rico, Americann               Samoa,
  Guam, the Commonwealth of the Northern Mariana Islands, and the U.S. Virgin Islands
  once each decade following the decennial census. Data usersn               should
  not use ZCTAs to identify the official USPS ZIP Code for mail delivery. The USPS
  makes periodic changes to ZIP Codes to support more efficientn               mail
  delivery.nn               The Census Bureau uses tabulation blocks as the basis
  for defining each ZCTA. Tabulation blocks are assigned to a ZCTA based on the most
  frequentlyn               occurring ZIP Code for the addresses contained within
  that block. The most frequently occurring ZIP Code also becomes the five-digit numeric
  code of then               ZCTA. These codes may contain leading zeros.nn               Blocks
  that do not contain addresses but are surrounded by a single ZCTA (enclaves) are
  assigned to the surrounding ZCTA. Because the Census Bureau onlyn               uses
  the most frequently occurring ZIP Code to assign blocks, a ZCTA may not exist for
  every USPS ZIP Code. Some ZIP Codes may not have a matching ZCTAn               because
  too few addresses were associated with the specific ZIP Code or the ZIP Code was
  not the most frequently occurring ZIP Code within any of then               blocks
  where it exists. nn               The ZCTA boundaries in this release are those
  delineated following the 2010 Census. n            \",\n\t\"license_title\": null,\n\t\"extras\":
